window.onload = pageLoad;

function pageLoad() {

  if(document.getElementById("is_doctor") && document.getElementById("is_doctor").value === "NO"){
    document.querySelectorAll(".fc-daygrid-event").forEach(function (item) {
      item.innerHTML = "BUSY"
    });
  }
}
